// src/components/Navbar.js
import React from 'react';
import styled from 'styled-components';
import { FaReact } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom'; // Optional, if you want programmatic navigation

const Nav = styled.nav`
  background: #0b59de;
  height: 60px;
  display: flex;
  justify-content: space-between;
  padding: 0 20px;
  align-items: center;
  color: #fff;
  position: sticky;
  top: 0;
  z-index: 999;
`;

const NavLogo = styled.button`
  background: none;
  border: none;
  color: #f2f2f2;
  display: flex;
  align-items: center;
  text-decoration: none;
  font-size: 24px;
  cursor: pointer;
`;

const NavMenu = styled.div`
  display: flex;
  gap: 20px;
`;

const NavItem = styled.button`
  background: none;
  border: none;
  color: #fff;
  cursor: pointer;
  &:hover {
    color: #de6e0b;
  }
`;

function Navbar() {
  const navigate = useNavigate(); // Use for routing if needed

  return (
    <Nav>
      <NavLogo onClick={() => navigate('/')}>
        <FaReact style={{ marginRight: '10px' }} />
        CODEV
      </NavLogo>
      <NavMenu>
        <NavItem onClick={() => navigate('/')}>Home</NavItem>
        <NavItem onClick={() => navigate('/surface-selection')}>Surface Selection</NavItem>
        <NavItem onClick={() => navigate('/peptide-selection')}>Peptide Selection</NavItem>
        <NavItem onClick={() => navigate('/glossary')}>Glossary</NavItem>
        <NavItem onClick={() => navigate('/features')}>Features</NavItem>
        {/* <NavItem onClick={() => navigate('/contributors')}>Contributors</NavItem> */}
        <NavItem onClick={() => navigate('/contact')}>Contact us</NavItem>
      </NavMenu>
    </Nav>
  );
}

export default Navbar;
